text:
La Commissione europea permette all'Irlanda di inserire sulle bottiglie di vino l'etichetta "pericoloso per la salute". 

Così si diffondono notizie false e  si mina un'eccellenza del Made in Italy. Pronti a opporci in ogni sede a questa scelta insensata.
@FratellidItalia https://t.co/LLQH9F8nhf

